      SELECT DISTINCT - - COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE 50 - - col0 NOT BETWEEN + col2 AND + col0 - ( ( + 63 ) );
  - name: tab1

outputs:
  - name: q2103.out
    data: |
      3
